import React from "react";
import { Routes, Route, Link, useNavigate } from "react-router-dom";
import styled from "styled-components";
import Step1Page from "../game/Step1Page";
import Step2Page from "../game/Step2Page";
import MyPage from "../MyPage";
import FailPage from "../result/FailPage";

const WarmingUpPage = () => {
  const navigate = useNavigate();
  return (
    <Wrap>
      <Logo>
        <h2>keyring gamble</h2>
      </Logo>
      <Menus>
        <Menu>
          <Link to={"/game/:username"}>
            <li>MY</li>
          </Link>
          <Link to={"/"}>
            <li>LOGOUT</li>
          </Link>
        </Menu>
      </Menus>

      <Routes>
        <Route path="/step1" element={<Step1Page />} />
        <Route path="/step2" element={<Step2Page />} />
        <Route path="/:username" element={<MyPage />} />
        <Route path="/result" element={<FailPage />} />
      </Routes>
    </Wrap>
  );
};

const Wrap = styled.div`
  width: 60%;
  height: 100%;
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: center;
`;

const HowBox = styled.div`
  width: 100%;
  height: 500px;
  padding: 5%;
  line-height: 2.5rem;
  box-sizing: border-box;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  background-color: pink;
  border-radius: 50px;
  font-size: 1.3rem;
  h2 {
    border-bottom: 1px solid #333;
  }
`;

const Btn = styled.button`
  width: 200px;
  height: 50px;
  border-radius: 5px;
  border-style: none;
  background-color: hotpink;

  font-size: 1rem;
  cursor: pointer;
`;

export default WarmingUpPage;
